import React from 'react'
import MainWelcome from './MainWelcome'
import MainPieChart from './MainPieChart'
import MainBarChart from './MainBarChart'

class Main extends React.Component{
	render(){
		return(
		<div className='main'>
            <MainWelcome />
            <MainPieChart />
            <MainBarChart />
		</div>
		)
	}
}

export default Main
